window.bookSummaryJSON = "<p><b>Titan's revolution is coming.</b> <b>All it needs is one final spark.</b>&nbsp;</p> <p>After decades hunting wanted offworlders throughout the solar system, Corporate Bounty Hunter Malcolm Graves doesn't bother asking questions. So long as the pay is right, he's the man for the job. And he <i>always </i>works alone.&nbsp;</p> <p>But when a high-profile bombing on Earth has Pervenio Corp clamoring for answers, they force him to team up with a strange, cyber-augmented partner. A young man more interested in statistics than instinct. Their assignment: Track down a suspected group of extremists from Titan who will go to any length to free their moon from the grip of Earth's corporations.&nbsp;</p> <p>Heading into hostile territory, Malcolm will have to use everything he's learned to stay alive. But he soon realizes the situation on the ground is much more complex than he anticipated...and much more personal.&nbsp;</p> <p><b>Experience the epic first entry in the Children of Titan series. If you're a fan of </b><b><i>The Expanse</i></b><b>, </b><b><i>Blade Runner</i></b><b>, or Star Wars, you'll love this gritty, space opera thriller from </b><b><i>USA Today</i></b><b> best-seller Rhett C. Bruno!</b>&nbsp;</p>"; 
